  <script>

      

       var btn = $(""#btnFinger"");
      btn.on('click', function () {
          FingerPrint();
      });

      function FingerPrint() {
          var _category = $(""input[name='category']:checked"").val();
          var msg = $(""#msg1"");
          var ok = $(""#ok1"");
          var overlay = $(""#overlay"");

          if (_category == undefined) {
              alert(""!!! الرجاء تحديد الوصف"");
              return;
          }
          var url = '/Home/FingerPrint';// Url.Action(""OnPostAsync"", ""Index"");


          $.ajax({
              type: ""GET"",
              url: url + ""?category="" + _category,
              contentType: ""application/json"",
              async: true,
              beforeSend: function () {
                  overlay.show();
              },
              success: function (response) {
                  overlay.hide();
                  msg.show();

                  btn.css(""border"", ""border: 2px solid green;"");
                  bt");
                WriteLiteral(@"n.attr(""src"", ""img/ok.png"");
                  setTimeout(function () { btn.attr(""src"", ""img/fingar.png""); }, 1000);
                  setTimeout(function () {
                      msg.hide();

                      btn.css(""border"", ""none"")
                  }, 4000);

              },
              error: function (err) {
                  console.log(err);
                  overlay.hide();
                  msg.hide();
                  alert('حدث خطأ اثناء اخذ البصمة، الرجاء تواصل معنا');
